import React, { useEffect } from "react";
import './App.css';

const API_URL = 'http://www.omdbapi.com/?i=tt3896198&apikey=b91d937b';

const movie1={
    "Title": "Italian Spiderman",
    "Year": "2007",
    "imdbID": "tt2705436",
    "Type": "movie",
    "Poster": "https://m.media-amazon.com/images/M/MV5BZWQxMjcwNjItZjI0ZC00ZTc4LWIwMzItM2Q0YTZhNzI3NzdlXkEyXkFqcGdeQXVyMTA0MTM5NjI2._V1_SX300.jpg"
};
const App = () => {

    const searchMovies = async (title) => {
        const response = await fetch(`${API_URL}&s=$(title)`);
        const data = await response.json();
        console.log(data.Search);
    }

    useEffect(() => {
        searchMovies('Spiderman');
    }, []);

    return (
        <div className="app">
            <h1>Movieland</h1>\
            <div className="search">
                <input placeholder="Search for movies" value="superman" onChange={()=>{}}></input>
                <button onClick={()=>{}}>search</button>
            </div>

            <div className="container">
                <div className="movie">
                    <div>
                        <p>{movie1.Year}</p>
                    </div>
                    <div>
                        <img src={movie1.Poster!=='N/A'?movie1.Poster:'https://via.placeholder.com/400'} alt={movie1.Title}></img>
                    </div>
                    <span>{movie1.Type}</span>
                    <h3>{movie1}</h3>
                </div>
            </div>
        </div>
        
    );
}

export default App;
